import React from "react";
import profilePhoto from "../assets/profile.png";

const About = () => {
  return (
    <section id="about" style={{ padding: "65px", textAlign: "center" }}>
      <h2>Tentang Saya</h2>
      <img
        src={profilePhoto}
        alt="Foto Profil"
        style={{ width: "150px", height: "250px", marginBottom: "20px" }}
      />
      <p>Saya seorang Software Engineer dengan pengalaman di pengembangan web dan mobile.</p>
    </section>
  );
};

export default About;
